const Counter = () => {
	let isLogedIn = false;
	if (isLogedIn) {
		return (
			<div className="container d-flex justify-content-between align-items-center">
				<h2>Welcome Back !!!!!!<br/> how is your day ????????????</h2>
			</div>
		);
	} else {
		return (
			<div className="mt-5 container d-flex justify-content-between align-items-center flex-column">
				<input type="email" placeholder="enter your email" />
                <br/>
				<input type="password" placeholder="enter your password" />
				
			</div>
		);
	}
};

export default Counter;
